    /**
     * @dataProvider dataSelectFromTypes
     * @param \PHPStan\Type\Type[] $types
     * @param ParametersAcceptor[] $variants
     * @param bool $unpack
     * @param ParametersAcceptor $expected
     */
    public function testSelectFromTypes(array $types, array $variants, bool $unpack, \TenantCloud\BetterReflection\Relocated\PHPStan\Reflection\ParametersAcceptor $expected) : void
    {
        $selectedAcceptor = \TenantCloud\BetterReflection\Relocated\PHPStan\Reflection\ParametersAcceptorSelector::selectFromTypes($types, $variants, $unpack);
        $this->assertCount(\count($expected->getParameters()), $selectedAcceptor->getParameters());
        foreach ($selectedAcceptor->getParameters() as $i => $parameter) {
            $expectedParameter = $expected->getParameters()[$i];
            $this->assertSame($expectedParameter->getName(), $parameter->getName());
            $this->assertSame($expectedParameter->isOptional(), $parameter->isOptional());
            $this->assertSame($expectedParameter->getType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), $parameter->getType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()));
            $this->assertTrue($expectedParameter->passedByReference()->equals($parameter->passedByReference()));
            $this->assertSame($expectedParameter->isVariadic(), $parameter->isVariadic());
            if ($expectedParameter->getDefaultValue() === null) {
                $this->assertNull($parameter->getDefaultValue());
            } else {
                $this->assertSame($expectedParameter->getDefaultValue()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), $parameter->getDefaultValue() !== null ? $parameter->getDefaultValue()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()) : null);
            }
        }
        $this->assertSame($expected->getReturnType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), $selectedAcceptor->getReturnType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()));
        $this->assertSame($expected->isVariadic(), $selectedAcceptor->isVariadic());
    }
